public class Solution {
    public int MinimumBeautifulSubstrings(string s) {
        if (s[0] == '0') return -1;
        int n = s.Length, res = int.MaxValue;
        int[] dp = new int[n + 1];
        Array.Fill(dp, int.MaxValue);
        dp[0] = 0;
        for (int i = 1; i <= n; i++) {
            long num = 0;
            for (int j = i; j >= 1; j--) {
                num = num / 2 + (s[j - 1] - '0') * (1L << (i - j));
                if (s[j - 1] == '0') continue; // skip leading zeros
                if ((num & (num - 1)) == 0 && (num % 5 == 0)) // check if power of 5
                    dp[i] = Math.Min(dp[i], dp[j - 1] + 1);
            }
        }
        return dp[n] == int.MaxValue ? -1 : dp[n];
    }
}
